import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    const title = document.querySelector("h1");
    console.log(window.innerHeight);

    title.style.setProperty("--x", `${Math.ceil(Math.random() * 200)}px`);
  });
  return (
    <>
      <div className="container">
        <div className="box">
          <h1>Capital de la France</h1>
          <button className="btn1">Marseille</button>
          <button className="btn2">Paris</button>
        </div>
      </div>
    </>
  );
};

export default App;
